import { Link } from "react-router-dom";
import "../../css/common.scss";

const Login = () => {
    const currentPath = window.location.pathname;

    const btnLogin = async (event: React.FormEvent<HTMLFormElement>) => {
        event.preventDefault();
        const emailValue = (event.currentTarget.elements.namedItem("email") as HTMLInputElement).value;
        console.log(emailValue);
      };

    return (
        <div className="bg-white py-5">
            <div className="container d-flex justify-content-center flex-column">

                <div className="d-flex w-100 justify-content-center btn-a">
                    <Link to={'/login'} className={`fs-25 mb-5 ${currentPath === '/login' ? 'active' : ''}`}>Đăng nhập</Link>
                    <Link to={'/register'} className={`fs-25 mb-5 ${currentPath === '/register' ? 'active' : ''}`}>Đăng ký</Link>
                </div>
                <form className="w-500px mx-auto">
                    <div className="form-outline mb-4">
                        <label className="form-label" >Email</label>
                        <input type="email" className="form-control" />
                    </div>
                    <div className="form-outline mb-4">
                        <label className="form-label">Password</label>
                        <input type="password" className="form-control" />

                    </div>
                    <button type="submit" onClick={(e)=>btnLogin(e)} className="btn btn-primary btn-block mb-4">Đăng nhập</button>

                </form>
            </div>

        </div>

    )
}

export default Login;
